import React, { useEffect, useState } from "react";
import { getFormulaire } from "../services/ApiService";
export default function FormulaireList() {
const [formulaire,setFormulaires]=useState([])
useEffect(()=> {
    let mount = true
    getFormulaire()
    .then(res => {
        setFormulaires(res)
        return()=> mount = false
    })
},[])

    return(
        <>
        <h3> Formulaire</h3>
        <table>
            <thead>
                <td>Nom</td>
                <td>Prenom</td>
                <td>Email</td>
            </thead>
            <tbody>
                {formulaire.map(formulaire =>{
                return <tr key={formulaire.formulaire_id}>
                <td>{formulaire.nom}</td>
                <td>{formulaire.prenom}</td>
                <td>{formulaire.mail}</td>
                <td><button type="submit">Enoyer</button> </td>
                
            </tr>
                })}
                
            </tbody>
        </table>
        
        </>
    )
    
}
